import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          hey, i'm amelia kaufman.
        </p>
        <p> i am a <span><b>software engineering manager</b></span> for my day job.
        </p>
        <p>
          at night, i am currently a <span>masters candidate in computer science</span> at <span>georgia tech</span> with a specialiation in <span>ml/ai</span>.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
